import React from 'react';
import Achivements from '../../assets/images/achievements.svg';

function UserStats() {
    return (
        <section className='w-1/3 '>
            <ul className='flex flex-col gap-4'>
                <li class="block max-w-sm p-6 bg-white border border-gray-200 rounded-lg">
                    <h5 class="mb-2 text-xl font-bold tracking-tight text-gray-900 dark:text-white">Achievements</h5>
                    <img src={Achivements} alt='Achivements picture' className='size-20' />
                    <p class="font-normal text-gray-700 dark:text-gray-400">Here are the biggest enterprise technology acquisitions of 2021 so far, in reverse chronological order.</p>
                </li>
                <li class="block max-w-sm p-6 bg-white border border-gray-200 rounded-lg">
                    <h5 class="mb-2 text-2xl font-bold tracking-tight text-gray-900 dark:text-white">progress bar of each difficulty</h5>
                    <p class="font-normal text-gray-700 dark:text-gray-400">Here are the biggest enterprise technology acquisitions of 2021 so far, in reverse chronological order.</p>
                </li>
                <li class="block max-w-sm p-6 bg-white border border-gray-200 rounded-lg">
                    <h5 class="mb-2 text-2xl font-bold tracking-tight text-gray-900 dark:text-white">leaderboard</h5>
                    <p class="font-normal text-gray-700 dark:text-gray-400">Here are the biggest enterprise technology acquisitions of 2021 so far, in reverse chronological order.</p>
                </li>
            </ul>
        </section>
    );  
}

export default UserStats;
